import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import '../styles/LoginComponent.css'



class Parent extends Component{

    constructor(props){
        super(props);
        this.state={
            signup: false, login: true
        }
        console.log(this);
        this.switch=this.switch.bind(this)

    }

    switch(word) {
        var signup, login;
        if (word == "signup") { signup = true; login = false; }
        else { login = true; signup = false; }
        console.log(this);

        return this.setState({ login: login, signup: signup })

    }
    render() {

        return (
            <div>
                <div id="buttons">
                    <p id="signupButton" onClick={this.switch.bind(null, "signup")} className={this.state.signup ? "yellow" : "blue"}>Sign Up</p>
                    <p id="loginButton" onClick={this.switch.bind(null, "login")} className={this.state.login ? "yellow" : "blue"}> Login</p>
                </div>

                {this.state.signup ? <Signup /> : null}
                {this.state.login ? <Login /> : null}

            </div>

        )


    }
}


class Signup extends Component{


    render() {


        return (
            <div>

                <div id="signup">
                    <input type="text" id="first" placeholder="First Name" />
                    <input type="text" id="last" placeholder="Last Name" />
                    <input type="email" id="email" placeholder="Email" />
                    <input type="password" id="password" placeholder="Password" />
                    <input type="password" id="confirm" placeholder="Confirm Password" />
                    <button id="send">Sign Up</button>
                </div>
            </div>

        )
    }
}

class Login extends Component{
    render() {



        return (

            <div>

                <div id="login">
                    <input type="email" id="email" placeholder="Email" />
                    <input type="password" id="password" placeholder="Password" />
                    <button id="send">Login</button>
                </div>

            </div>

        )
    }
}


//   ReactDOM.render(<Parent/>,document.getElementById("space"))




export default Parent;
